import React, { Component } from 'react';
import { connect } from 'react-redux';
import './HomeHeader.scss';

class HomeHeader extends Component {

    render() {

        return (
            <div className='home-header-container'>
                <div className='home-header-content'>
                    <div className='left-content'>
                        <i className='fas fa-bars'></i>
                        <div className='header-logo'></div>
                    </div>
                    <div className='center-content'>
                        <div className='child-center-content'><b>Trang chủ</b></div>
                        <div className='child-center-content'><b>Giới thiệu</b></div>
                        <div className='child-center-content'><b>Thiết kế & thi công bể thủy sinh</b></div>
                        <div className='child-center-content'><b>Danh mục sản phẩm</b></div>
                        <div className='child-center-content'><b>Chia sẻ kiến thức & tin tức</b></div>
                    </div>
                    <div className='right-content'>
                        <div className='support'><i className='fas fa-question-circle'></i> Hỗ trợ</div>
                        <div className='flag'>Việt Nam</div>
                        <div className='login'>Đăng nhập</div>
                        <div className='register'>Đăng ký</div>
                    </div>
                </div>
            </div>
        );
    }

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeHeader);
